import { Container, Row, Col } from 'react-bootstrap';
import {Jumbotron, Services} from '../presentational';

const Home = () => {
    return (
        <div>
            <Jumbotron jumboShow = {true} />

            <Container>
                <Col className = "text-center" >
                    <h2 className = "services-container">Our Services</h2>
                </Col>
                <Row>
                    <Services />
                </Row>
            </Container>
        </div>
    )
}

export default Home
